'''Trader Crewmembers''' are employees of [[Trader Stan]], who runs the [[charter ship]] system that operates all over [[Gielinor]]. At each port, there are two crewmembers, with the exception of [[Port Sarim]] and [[Corsair Cove]], where Trader Stan himself is also present. Players may charter passage between ports for large sums of [[coins]] ranging from 200 to 3,200, destinations include [[Brimhaven]], [[Karamja]], [[Port Khazard]], [[Port Phasmatys]], [[Port Sarim]], [[Corsair Cove]], and the [[Shipyard]]. Crewmembers also run [[Trader Stan's Trading Post]], an exotic store containing a variety of items, including the otherwise-unobtainable [[Tyras helm]].

The Crewmembers dress in very fine clothes, and can be asked about it, claiming that Trader Stan makes them wear the top-of-the-line garments to keep at the height of fashion. They then make a flippant comment about how they will resign if they fall overboard again.
